import React from "react";
import BlogCard from '../components/card/BlogCard'

function Blog() {
  return (
    <div>
      <div>
        Test
      </div>
      <BlogCard
        title="This is the post title"
        author="u/username"
        score={1000}
        subreddit="reactjs"
        thumbnail="https://via.placeholder.com/150"
        url="https://www.reddit.com/r/reactjs/comments/abcdefg"
      />
    </div>
  );
}

export default Blog;
